export function getProperties(values, defaultProperties, target) {
    return defaultProperties;
}

export function getPreview(values, isDarkMode) {
    const titleHeader = {
        type: "RowLayout",
        columnSize: "grow",
        backgroundColor: isDarkMode ? "#2A324C" : "#DCEEFE",
        borders: true,
        borderWidth: 1,
        children: [
            {
                type: "Container",
                padding: 4,
                children: [
                    {
                        type: "Text",
                        fontColor: isDarkMode ? "#579BF9" : "#2D2FB8",
                        content: "Tab click on: " + values.tabName
                    }
                ]
            },
            {
                type: "Container",
                padding: 5,
                grow: 0,
                children: [
                    {
                        type: "Image",
                        width: 25,
                        data: ""
                    }
                ]
            }
        ]
    };
    const children = [titleHeader];
    return {
        type: "Container",
        children: children
    };
}
